import requests

url = "https://leetcode-api.p.rapidapi.com/leetcode/histogram"
querystring = {"limit": limit, "username": username}

headers = {
    "X-RapidAPI-Key": "SIGN-UP-FOR-KEY",
    "X-RapidAPI-Host": "leetcode-api.p.rapidapi.com"
}

response = requests.get(url, headers=headers, params=querystring)

print(response.json())

